import type { Task } from "./Transition"

type Props = {
    taskList: Task[]
}

export const taskList = ({ taskList }: Props) => {
    return (
        <>
            {taskList.map((task) => (
                <div key={task.id} style={{ width: '300px' , margin: 'auto', backgroundColor: 'lavender'}}>
                    <p>タイトル：{task.title}</p>
                    <p>担当：{task.assignee}</p>
                </div>
            ))}
        </>
    )
}
